import React, { Component } from 'react';

class Weather extends Component {
  render() {
    return (
      <div>
        { this.props.city &&
          <div>
            <p>Местоположение: <span>{this.props.city}</span>, <span>{this.props.country}</span></p>
            <p>Температура: <span>{this.props.temp}</span></p>
            <p>Давление: <span>{this.props.pressure}</span></p>
            <p>Заход солнца: <span>{this.props.sunset}</span></p>
          </div>
        }

      </div>
    )
  }
}

export default Weather;
